INSERT INTO `intervenciones` VALUES (1,'2017-04-10',NULL,'PROCURACION CAUSA FAMILIA',3,11,'2019-09-05 16:01:31',NULL,'2019-09-05 16:01:31',NULL),(2,'2018-11-21',NULL,'NOS ACERCAMOS AL HOSPITAL SAN MARTIN A REALIZAR UNA ENTREVISTA PERSONAL CON LOS PADRES DE KEVIN QUIENES REFIEREN QUE ESTAN PREOCUPADOS POR LA SALUD DE SU HIJO AUNQUE SEGUN EL PARTE MEDICO EVOLUCIONA FAVORABLEMENTE COORDINAMOS LAS CO-GESTIONES CON EL SERVICIO SOCIAL DEL HOSPITAL PARA NO SUPERPONER INTERVENCIONES ASIMISMO PAUTAMOS QUE LUEGO DE LA RECUPERACION DE SU HIJO NOS COMUNICAREMOS PARA ASESORARLOS JURIDICAMENTE  ACERCA DEL ESTADO DE LA CAUSA PENAL',10,17,'2019-09-05 16:23:39',NULL,'2019-09-05 16:23:39',NULL),(3,'2018-11-22',NULL,'NOS COMUNICAMOS CON ALEJANDRA LA MAMÁ DE KEVIN Y NOS MANIFIESTA QUE SU HIJO SE ENCUENTRA FUERA DE ESTADO DE PELIGRO HA MEJORADO SU ESTADO DE SALUD YA QUE LE SACARON EL RESPIRADOR ARTIFICIAL LO CUAL LOS MANTIENE MUCHO MAS RELAJADOS PAUTAMOS COMUNICARNOS CON SU LUGAR DE TRABAJO PARA CONSULTAR POR LOS CERTIFICADOS PARA LA LICENCIA PERSONAL EN TANTO NECESITA ACOMPAÑAR A SU HIJO EN ESTE MOMENTO\r\nNOS COMUNICAMOS CON DANIEL SOSA DIR DE LA ESCUELA DONDE TRABAJA ALEJANDRA QUIEN NOS SOLICITO SI PODEMOS GESTIONAR EL CERTIFICADO DE SALUD MENTAL A NOMBRE DE ALEJANDRA QUE LE EXTIENDAN LA LICENCIA YA QUE LA LICENCIA POR FAMILIAR A CARGO SE AGOTA A LOS 20 DIAS HABILES GESTIONAREMOS CON ALEJANDRA Y EL EQUIPO DEL HOSPITAL SAN MARTÍN LA SOLICITUD',10,17,'2019-09-05 16:27:56',NULL,'2019-09-05 16:27:56',NULL),(7,'2018-11-23',NULL,'NOS COMUNICAMOS CON ALEJANDRA QUIEN NOS REFIERE QUE SU HIJO SE ENCUENTRA MUY BIEN QUE HABLA Y QUE SE ENCUENTRA CON BUEN ESTADO DE ÁNIMO LE COMENTAMOS A ALEJANDRA LA POSIBILIDAD DE EXTENDER LA LICENCIA POR SALUD MENTAL Y  AFIRMA QUE ELLA QUIERE ESTAR CON SU HIJO HASTA QUE LE DEN EL ALTA POR LO QUE ACEPTA LA INTERVENCIÓN ALEJANDRA NOS COMENTA QUE ESTÁN SUMAMENTE AGRADECIDOS POR EL ACOMPAÑAMIENTO Y LA CONTENCIÓN DEL EQUIPO COORDINAMOS CON EL SERVICIO SOCIAL Y DE SALUD MENTAL DEL HOSPITAL',10,17,'2019-09-05 16:34:19',NULL,'2019-09-05 16:34:19',NULL),(8,'2019-01-19',NULL,'NOS COMUNICAMOS CON SEBASTIÁN ZUÑIGA SOBRINO DE GISSELLA TEL 221-620-7807 LUEGO DE VER LA NOTICIA EN LOS MEDIOS DE COMUNICACIÓN POR LA DESAPARICIÓN DE SU TÍA SEBASTIÁN MANIFIESTA QUE LA ÚNICA INFORMACIÓN QUE MANEJAN ES LA BRINDADA POR EL SR OCAMPO  PAREJA DE GISELLA  QUIEN REFIERE QUE DISCUTIERON EL MIÉRCOLES POR LA NOCHE Y NO VOLVIÓ A TENER COMUNICACIÓN CON ELLA  TAMBIÉN REFIRIÓ QUE OCAMPO AÚN NO SE HA PRESENTADO EN SEDE POLICIAL PARA APORTAR MAYOR INFORMACIÓN LA FAMILIA POR EL MOMENTO NO REQUIRIÓ UNA INTERVENCIÓN EN PRESENCIA PERO ACCEDIÓ A CONTINUAR LA COMUNICACIÓN DURANTE EL FIN DE SEMANA POR CUALQUIER COSA QUE PUEDAN NECESITAR',9,21,'2019-09-05 16:35:14',NULL,'2019-09-05 16:35:14',NULL),(9,'2018-11-27',NULL,'NOS COMUNICAMOS CON ALEJANDRA MANIFIESTA QUE ESTÁN ALIVIADOS YA QUE KEVIN YA SE PUDO LEVANTAR Y CAMINA QUE DENTRO DE TRES O CUATRO DÍAS LE DAN EL ALTA NOS REFIERE LA NECESIDAD DE CONTAR CON EL CERTIFICADO O CARPETA MÉDICA POR 30 O 60 DÍAS PARA ESTAR MÁS TRANQUILA ACOMPAÑANDO A SU HIJO Y AYUDARLO EN LA RECUPERACIÓN',10,17,'2019-09-05 16:35:15',NULL,'2019-09-05 16:35:15',NULL),(10,'2018-11-28',NULL,'NOS ACERCAMOS AL SERVICIO DE SALUD MENTAL DEL HOSPITAL SAN MARTÍN PARA CONVERSAR CON LA JEFA DE SERVICIO LA LIC PARRA LORENA EN VIRTUD DE QUE PUEDAN EVALUAR LA SITUACIÓN DE KEVIN Y DE SU FAMILIA CON EL FIN DE OTORGAR EL CERTIFICADO PARA LA LICENCIA LABORAL DE ALEJANDRA\r\nNOS COMUNICAMOS CON ALEJANDRA PARA ANOTICIAR DE DICHA INTERVENCIÓN ALEJANDRA NOS REFIERE QUE SU HIJO SIGUE EVOLUCIONANDO BIEN Y QUE ESTÁN SUMAMENTE AGRADECIDOS POR EL ACOMPAÑAMIENTO BRINDADO',10,17,'2019-09-05 16:36:24',NULL,'2019-09-05 16:36:24',NULL),(11,'2018-11-30',NULL,'NOS COMUNICAMOS CON ALEJANDRA PARA COMENTARLE QUE DESDE EL SERVICIO DE SALUD MENTAL DEL HOSPITAL SOLICITAN QUE SE REALICE EL DERROTERO INSTITUCIONAL CORRESPONDIENTE PARA GESTIONAR EL CERTIFICADO O CARPETA PSIQUIÁTRICA LO 