10 RECIBIO UNA GOLPIZA QUE LE DEJARON SECUELAS A PARTIR DE LAS CUALES DEBIO HACER TRATAMIENTO SEGUN LOS DICHOS EN FORMA DISCONTINUA\r\n              ROMINA PRESENTA CONSUMO DE ALCOHOL DE LARGA DATA Y SIN TRATAMIENTO\r\n	MILENA ALGUNA VEZ LE DIJO A SU MADRE QUE QUERIA HACER TRATAMIENTO\r\nFINALIZANDO LA ENTREVISTA PREGUNTA SI LA PENSION DE SU MADRE UNA VEZ QUE FALLEZCA PODIA PASAR A NOMBRE DE SU HIJO\r\nEL EQUIPO LE EXPLICA LA MODALIDAD DE TRABAJO LA EX PAREJA EXPRESA QUE EL SE ENCUENTRA REALIZANDO TRATAMIENTO PSICOLOGICO Y QUE POR AHI ESTARIA BUENO QUE ELLA INICIE TAMBIEN PARA TENER SU ESPACIO A LO CUAL SILVIA DICE QUE SI SIN MOSTRAR MUCHO INTERES DIJO QUE EN VARIAS OPORTUNIDADES INICIO PERO NO PUDO SOSTENER NINGUNO DE LOS TRATAMIENTOS HABLAMOS DEL TEMA UN POCO MAS EN PROFUNDIDAD Y LE PEDIMOS QUE SI REALMENTE LE INTERESA LE PODEMOS CONSEGUIR TURNO EN ALGÚN LUGAR CERCANO A SU DOMICILIO PERO SIEMPRE Y CUANDO SE COMPROMETA Y DESEE INICIAR EL TRATAMIENTO SINO NO TIENE SENTIDO A LO CUAL EXPRESO QUE SI QUE QUERIA IR  NOS COMENTO QUE EL LUGAR MAS CERCANO ES EL CENTRO DE SALUD N 8 \r\nQUEDAMOS EN VER LA CAUSA Y COMUNICARLES LAS NOVEDADES',8,48,'2019-09-05 17:02:17',NULL,'2019-09-05 17:02:17',NULL),(30,'2019-03-11',NULL,'EN EL DIA DE LA FECHA NOS COMUNICAMOS CON LA LICENCIADA ANDREA CHAVEZ DEL CENTRO DE SALUD NUMERO 8 DE ALTOS DE SAN LORENZO TELEFONO 451 5845 SOLICITAMOS TURNO PARA LA  SEÑORA SILVIA LUDUEÑA NOS OFRECEN TURNO PARA EL DIA LUNES 18 DE MARZO A LAS 1030 HORAS LUEGO HABLAMOS CON SILVIA QUIEN SE COMPROMETE A ASISTIR AL TURNO',8,48,'2019-09-05 17:03:10',NULL,'2019-09-05 17:03:10',NULL),(31,'2018-08-14',NULL,'EL CASO INGRESA DE OFICIO A TRAVÉS DE LA GUARDIA DEL FIN DE SEMANA EL EQUIPO DE GUARDIA SE COMUNICÓ CON JULIAN 24 AÑOS HERMANO DE LA VÍCTIMA QUIEN REFIERE QUE LOS AGRESORES QUE ATACARON A SU HERMANO SON UNA FAMILIA CONOCIDA DEL BARRIO DE HACE TIEMPO RELACIONADA A LA DELINCUENCIA Y MENCIONA QUE HASTA SE CREE QUE ESTARÍAN ACTUANDO EN CONNIVENCIA CON LA POLICÍA\r\n